import React, { useState, useEffect } from "react";

const SpotifyData = () => {
  const accessToken =
    "BQCM3siJdc7P30lwa0NjYe8ejH3bsvMPW_gvSbz4s1gpwr6yv1fK1TmeNEPo4W_P3NNUbXxmmZTxWLZceGyVJO8NNbh84dg00969iZzNO0wzoquJ_9R-a9J7yttlLkrhFCdqu1Xv7JXrFIBUakM-4PAFy17AveFLoAyhQjjDkQv3xLp6ZPxHv6YMO3e48l6w_VipAYmVq1PRwHltCAEK1OI8v_8CQCZJyu_mc8C_eAHB77UQE3ktS6O1wEhKrrfuSclcOFJY02YhPtdn_HCpBnCHw4qGhbbLVIUSYeO1RdCw3pOMQDswmF1nsRrAxlj_UvMrYNWwxnTsOviOafMJxeYzsFnZ";

  // Tillstånd för att lagra den hämtade datan
  const [spotifyData, setSpotifyData] = useState(null);

  useEffect(() => {
    // Definiera URL:en till API-slutpunkten du vill hämta data från
    const apiUrl = "https://api.spotify.com/v1/artists/53XhwfbYqKCa1cC15pYq2q";

    // Skapa en konfiguration för fetch-begäran
    const fetchConfig = {
      method: "GET",
      headers: {
        Authorization: `Bearer ${accessToken}`,
      },
    };

    // Gör en fetch-begäran till Spotify API-slutpunkten med åtkomsttokenen
    fetch(apiUrl, fetchConfig)
      .then((response) => {
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        return response.json();
      })
      .then((data) => {
        // Sätt den hämtade datan i tillståndet
        setSpotifyData(data);
      })
      .catch((error) => {
        console.error("There was a problem with the fetch operation:", error);
      });
  }, [accessToken]); // Uppdatera bara när accessToken ändras

  // Visa den hämtade datan i JSX-format
  return (
    <div>
      <h2>Spotify Data</h2>
      {spotifyData && (
        <div>
          {/* Visa den hämtade datan här */}
          <p>{JSON.stringify(spotifyData)}</p>
          <p>ARTIST: {spotifyData.artist}</p>
        </div>
      )}
    </div>
  );
};

export default SpotifyData;
